import React from "react";
import { BrowserRouter as useRouteMatch, Link } from "react-router-dom";
import Menutabs from "./Menutabs";
import Paper from "@mui/material/Paper";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TablePagination from "@mui/material/TablePagination";
import TableRow from "@mui/material/TableRow";
import { Bolt } from "@mui/icons-material";
import { MdOutlinePreview } from "react-icons/md";
import { FaEdit } from "react-icons/fa";

const columns = [
  { id: "empid", label: "Employee ID", minWidth: 120 },
  { id: "ename", label: "Employee Name", minWidth: 120 },
  { id: "designation", label: "Designation", minWidth: 120 },
  { id: "jdate", label: "Joining Date", minWidth: 120 },
  { id: "status", label: "Status", minWidth: 120 },
  { id: "actions", label: "Actions", minWidth: 80 },
];

function createData(empid, ename, designation, jdate, status) {
  return { empid, ename, designation, jdate, status };
}

const rows = [
  createData("EMP001", "John Doe", "Software Engineer", "01/01/2022", "Active"),
  createData("EMP002", "Jane Smith", "Project Manager", "05/15/2021", "Active"),
  createData("EMP003", "Alice Johnson", "Data Analyst", "03/20/2023", "Active"),
  createData("EMP004", "Michael Brown", "Software Developer", "11/10/2021", "Active"),
  createData("EMP005", "Emma Garcia", "Business Analyst", "07/08/2022", "Active"),
  createData("EMP006", "William Martinez", "Quality Assurance", "09/25/2023", "Active"),
  createData("EMP007", "Olivia Anderson", "UI/UX Designer", "04/05/2021", "Active"),
  createData("EMP008", "James Wilson", "System Administrator", "02/14/2022", "Active"),
  createData("EMP009", "Ella Taylor", "Network Engineer", "06/30/2023", "Active"),
  createData("EMP010", "Noah Thomas", "Database Administrator", "08/17/2021", "Active"),
  createData("EMP011", "Isabella Hernandez", "Cybersecurity Analyst", "10/29/2022", "Active"),
  createData("EMP012", "Liam Lopez", "DevOps Engineer", "12/12/2023", "Active"),
  createData("EMP013", "Sophia Scott", "Software Tester", "03/18/2021", "Active"),
  createData("EMP014", "Mason Green", "Product Owner", "07/22/2022", "Active"),
  createData("EMP015", "Ava Adams", "Scrum Master", "11/05/2023", "Active"),
  createData("EMP016", "Harper Baker", "Technical Writer", "05/14/2021", "Active"),
  createData("EMP017", "Evelyn Rivera", "Business Intelligence Analyst", "01/29/2022", "Active"),
  createData("EMP018", "Alexander Reed", "Frontend Developer", "09/10/2023", "Active"),
  createData("EMP019", "Charlotte Perez", "Backend Developer", "06/07/2021", "Active"),
  createData("EMP020", "Ryan Roberts", "Full Stack Developer", "04/02/2022", "Active"),
];

export default function StickyHeadTable() {
  const [page, setPage] = React.useState(0);
  const [rowsPerPage, setRowsPerPage] = React.useState(10);
  const match = useRouteMatch("/pim/addemployee");

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(+event.target.value);
    setPage(0);
  };

  return (
    <div>
      {match && <Menutabs />}{" "}
      <Paper
        sx={{ overflow: "hidden" }}
        className="md:w-[100%] w-[calc(100vw-0.8rem)]"
      >
        <TableContainer
          sx={{ maxHeight: 530 }}
          className="m-2 pr-4 scrollbar-hide"
        >
          <Table stickyHeader aria-label="sticky table">
            <TableHead className="">
              <TableRow>
                {columns.map((column) => (
                  <TableCell
                    key={column.id}
                    align="left"
                    style={{
                      minWidth: column.minWidth,
                      backgroundColor: "#EBE9F6",
                      fontWeight: Bolt,
                    }}
                  >
                    {column.label}
                  </TableCell>
                ))}
              </TableRow>
            </TableHead>
            <TableBody>
              {rows
                .slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
                .map((row) => (
                  <TableRow hover role="checkbox" tabIndex={-1} key={row.empid}>
                    {columns.map((column) => (
                      <TableCell key={column.id} align="left">
                        {column.id !== "actions" ? (
                          row[column.id]
                        ) : (
                          <div className="flex items-center gap-2">
                            <div className="hover:bg-[#dbd6fc] rounded-md p-2">
                              <Link to={`/edit/${row.empid}`}>
                                <FaEdit className="text-xl" />
                              </Link>
                            </div>
                            {" | "}
                            <div className="hover:bg-[#dbd6fc] rounded-md p-2">
                              <Link to={`/view/${row.empid}`}>
                                <MdOutlinePreview className="text-xl" />
                              </Link>
                            </div>
                          </div>
                        )}
                      </TableCell>
                    ))}
                  </TableRow>
                ))}
            </TableBody>
          </Table>
        </TableContainer>
        <TablePagination
          rowsPerPageOptions={[10, 25, 100]}
          component="div"
          count={rows.length}
          rowsPerPage={rowsPerPage}
          page={page}
          onPageChange={handleChangePage}
          onRowsPerPageChange={handleChangeRowsPerPage}
          style={{ paddingRight: "5px" }}
        />
      </Paper>
    </div>
  );
}

